- run the snippet below, which creates a StyledText with 100 lines of text and selects characters 200-210
- it initially shows line 25 at the top, but once you touch the vertical scrollbar it puts line 7 at the top, indicating that they were out of sync when initially shown
- setting the selection after the shell is open works better

public static void main(String[] args) {
	Display display = new Display();
	Shell shell = new Shell(display);
	shell.setBounds(10, 10, 200, 200);
	shell.setLayout(new FillLayout());
	StyledText styledText = new StyledText(shell, SWT.V_SCROLL);
	StringBuilder source = new StringBuilder();
	for (int i = 0; i < 100; i++) {
		source.append(i);
		source.append(". line\n");
	}
	styledText.setText(source.toString());
	styledText.setSelection(200,210);
	shell.open();
	while (!shell.isDisposed()) {
		if (!display.readAndDispatch()) display.sleep();
	}
	display.dispose();
}

