Presently the framework does not provide a mechanism for implicitly granting permission to access the bundle's state location (or other path relative locations) from within the OSGI-INF/permission.perms file.

The preferred embodiment of the implementation would allow for the following relative path prefixes for java.io.FilePermission entries in permissions.perm:

@eclipse.state.location@ - The <osgi.instance.area>/.metadata/.plugin/<plugin_id> directory.
@osgi.instance.area@ - The <osgi.configuration.area> directory.
@osgi.install.area@ - The <osgi.install.area> directory.
@osgi.configuration.area@ - The <osgi.configuraiton.area> directory.

Created an attachment (id=53762) patch
Here is an updated patch after some review.
I changed the patch to use the following aliases
@osgi.install.area@ An alias to the install area (i.e. where eclipse.exe, start.jar etc. are)
@osgi.configuration.area@ An alias to the root configuration area.
@osgi.instance.area@ An alias to the root instance are (i.e. the workspace location)
@bundle.configuration.area@ An alias to a bundle's specific configuration area (e.g. configuration/<bundle symbolic name>)
@bundle.instance.area@ An alias to a bundle's specific instance area (e.g. workspace/.metadata/.plugins/<bundle symbolic name>)
I added the following lines the default implied permissions (java.io.FilePermission "@bundle.instance.area@" "read,write,delete") (java.io.FilePermission "@bundle.instance.area@-" "read,write,delete") (java.io.FilePermission "@bundle.configuration.area@" "read,write,delete") (java.io.FilePermission "@bundle.configuration.area@-" "read,write,delete")
I gave every bundle FULL control over each of their own bundle specific configuration and instance areas. This is needed so that they have rights to create the folder. Question: if a bundle needs to create their own bundle specific folder does that mean they need write access to the parent folder? This seems to work well if the areas are set ahead of time. For example, the configuration area is set from the very start of the framework. Other location areas maybe set later. For example, the instance area can be set by the workspace chooser dialog.
We need to do some more work to unresolve the implied permissions when a Location area has been set. This could be done in BasicLocation.setURL. Somehow we need to get access to every bundle's BundleCombindedPermissions.implied obect and call implied.unresolvePermissions method. This will cause the implied permissions to get re-evaluated using the new paths for the locations.

RuntimeBridge is undergoing non-deterministic behavior where the exact same set of plug-ins is behaving differently and unpredictably. 

Specifically:

RuntimeBridge's static initialization function contains the following code:

	private static void initialize() {
             // get from model / plugin.xmls
		RuntimeFacetMapping[] rfms = JavaServerPlugin.getRuntimeFacetMapping();
		int size = rfms.length;
		for (int i = 0; i < size; i++)
			addMapping(rfms[i].getRuntimeTypeId(), rfms[i].getRuntimeComponent(), rfms[i].getVersion());

AddMappings is essentially the following (try / catch removed)
			mappings.put(id, RuntimeManager.getRuntimeComponentType(id2).getVersion(version));


mappings is a hashmap of type <String runtimeTypeId, IRuntimeComponentVersion version>

If the plugin.xml files of various plugins contain a mapping involving the same wst runtime type id, only one of the facet runtimes (IRuntimeComponent) will be in the hashmap, specifically whichever was the last added. The behavior is unpredictable from installation to installation, but seems to be consistant within each installation. Perhaps it has something to do with the order plugins were installed. I'm not sure. 

I coded a patch for it, as well. I was told my patch would not be accepted because the future of the API would reconcile the two runtime models into one and remove the need for a runtime bridge, however no time estimate was given and if it is another year before such an API is available, I'd prefer the patch be accepted and applied. 

Non-deterministic behavior is simply intollerable.

My patch changes the mappings HashMap, 
From:  HashMap <String id, IRuntimeComponentVersion version> 
To:    HashMap <String id, ArrayList <IRuntimeComponentVersion> versions>



--- Some more justifications:

My specific usecase as to why I'd need multiple runtime-facet mappings is so that a third party plugin can declare that my server supports a facet type. 

If I've created a new facet type, and know that a server type already supports it, I'd like to create a new runtime component for that facet, and declare some wst server runtime supports that component. This way, the wst runtime's plugin.xml file does not need to go declaring support for every new facet type that shows up, but rather the facet creater can declare who already supports it. 

A quick fix, since I own both plugins, is to just go into the wst runtime's plugin.xml and declare my runtime type supports that facet in its primary component. But if a THIRD PARTY wants to declare my runtime type already supports THEIR facet, they will be unable to do so, and I will need to update my runtime to say it supports their facet.

