For non-native dialogs, a listener is registered with the Display object for different SWT events:

		display.addFilter(SWT.MouseUp, listener);
		display.addFilter(SWT.KeyUp, listener);
		display.addFilter(SWT.KeyDown, listener);
		display.addFilter(SWT.Selection, listener);
		display.addFilter(SWT.DefaultSelection, listener);
		display.addFilter(SWT.Expand, listener);
		display.addFilter(SWT.Collapse, listener);
		display.addFilter(SWT.Modify, listener);
		display.addFilter(SWT.Activate, listener);		
		display.addFilter(SWT.Close, listener);
		display.addFilter(SWT.FocusIn, listener);	

The event notifications are received and an appropriate command is created for each.  Understandably, a native dialog fails to report such events but there should still be other means of determining when a shell is native and what the response is.
